                if (chk.Checked)
                {
                    int reaid = Convert.ToInt32(BannerGrid.DataKeys[gvr.RowIndex].Value);
                    Banner_Master_C sampl = new Banner_Master_C();
                    sampl.delete(reaid, Convert.ToInt32(Session["Branchid"]));
